  [],\n\t\"num_tags\": 0,\n\t\"name\": \"temperature-profile-data-from-surface-sensors-bottle-casts-and-ctd-casts-from-the-noaa-ship-mil\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Temperature profile data were collected
  from surface sensors, bottle casts, and CTD casts from NOAA Ship MILLER FREEMAN
  from 18 September 1986 to 14 May 1987. Data were collected by the University of
  Alaska - Fairbanks; Institute of Marine Science (UAK/IMS) as part of Outer Continental
  Shelf Environmental Assessment Program (OCSEAP). Data were processed by NODC to
  the NODC standard F022 High-Resolution CTD/STD Output Format. Full format description
  is available from NODC at www.nodc.noaa.gov/General/NODC-Archive/f022.html. An analog
  file for this accession is available from NODC user services.nnThe F022 format contains
  high-resolution data collected using CTD (conductivity-temperature-depth) and STD
  (salinity-temperature-depth) instruments. As they are lowered and raised in the
  oceans, these electronic devices provide nearly continuous profiles of temperature,
  salinity, and other parameters. Data values may be subject to averaging or filtering
  or obtained by interpolation and may be reported at depth intervals as fine as 1m.
  Cruise and instrument information, position, date, time and sampling interval are
  reported for each station. Environmental data at the time of the cast (meteorological
  and sea surface conditions) may also be reported. The data record comprises values
  of temperature, salinity or conductivity, density (computed sigma-t), and possibly
  dissolved oxygen or transmissivity at specified depth or pressure levels. Data may
  be reported at either equally or unequally spaced depth or pressure intervals. A
  text record is available for comments.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
